Here is a sample code for a chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:
```
// manifest.json
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes screenshots of the current tab and saves them to a folder on your computer.",
  "manifest_version": 2,
  "background": {
    "scripts": ["background.js"]
  },
  "permissions": [
    "activeTab",
    "tabs",
    "storage"
  ]
}

// background.js
chrome.tabs.onActivated.addListener(function(tabId, changeInfo, tab) {
  chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
    var filename = "screenshot-" + Date.now() + ".png";
    chrome.downloads.download({
      url: dataUrl,
      filename: filename
    });
  });
});

// settings.html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension Settings</title>
  </head>
  <body>
    <h1>Screenshot Extension Settings</h1>
    <form>
      <label for="folder">Folder to save screenshots to:</label>
      <input type="text" id="folder" name="folder" value="~/Screenshots">
      <button type="submit">Save</button>
    </form>
  </body>
</html>

// settings.js
chrome.storage.sync.get("folder", function(items) {
  document.getElementById("folder").value = items.folder;
});

document.querySelector("form").addEventListener("submit", function(event) {
  event.preventDefault();
  var folder = document.getElementById("folder").value;
  chrome.storage.sync.set({folder: folder}, function() {
    console.log("Settings saved");
  });
});
```
